A live performance by Def Leppard &amp; Taylor Swift of Photograph from the show CMT Crossroads.



&quot;Photograph&quot; is one of the most famous songs and 1983 single by British hard rock band Def Leppard from their multi-platinum album Pyromania. It was written for the late Marilyn Monroe, as Joe Elliott often stated before playing the song live in concerts. When released as a single later that year, it reached #1 on the Mainstream Rock charts and #12 on Pop Singles. More recently, the song was used in promotional ads for the DVD release of Blades of Glory. Photograph is known for sparking the mainstream&amp;#039;s awareness of glam metal.





